import React from 'react';
import logo from './logo.svg';
import './App.css';
import TimeLine from '.Components/user/TimeLine/TimeLine';

export default class App extends React.Component {


    componentDidMount() {

        fetch('/timeline')
            .then(res => res.text())
            .then(res => console.log(res))
    }
    render() {

        return (
            <div className="App">
                <TimeLine />
            </div>
        );
    }
}
